import axios from "axios";
import {RENT_FAILURE, RENT_SUCCESS} from "./RentsConst";

const rentSuccess = (rent) => {
    return {
        type: RENT_SUCCESS,
        payload: rent,
    };
};

const rentFailure = (error) => {
    return {
        type: RENT_FAILURE,
        payload: error,
    };
};

export class RentService{

    baseUrl = "http://localhost:8080/api/v1/rent"

    getRentEmail(email){



        console.log(email);
        return axios.get(this.baseUrl +"?email="+ email).then(res => console.log(res));
    }

    getRentId(id){

        return axios.get(this.baseUrl + "/rented?id=" + id)
            .then((response) => {despatch(response.data)})
            .catch((error) => {
                dispatch(rentFailure(error));
            });
    }

    postCustomer(customer){
        return axios.post(this.baseUrl + "/create", customer).then(res => res.data);
    }
}
